using System.Collections;
using System.Collections.Generic;
using UnityEngine;
using WebSocketSharp;
using System;
using PimDeWitte.UnityMainThreadDispatcher;

public class WebSocketClient : MonoBehaviour
{
    private WebSocket ws;
    private WebsocketDataHandler dataHandler;
    private string webSocketUrl;

    private void Start()
    {
        dataHandler = GetComponent<WebsocketDataHandler>();
    }

    public void Disconnect()
    {
        try
        {
            if (ws != null && ws.IsAlive)
            {
                #if !UNITY_WEBGL
                    ws.Close();
                #endif
            }
        }
        catch (Exception ex)
        {
            // Handle or log the exception
            //Debug.LogError(\"Error occurred in ReConnect method: \" + ex.Message);
        }

    }

    public bool ReConnect(string connectionString)
    {
        try
        {
            if (ws != null && ws.IsAlive)
            {
                #if !UNITY_WEBGL
                    ws.Close();
                #endif
            }

            webSocketUrl = connectionString;
            #if !UNITY_WEBGL
                ws = new WebSocket(webSocketUrl);
                ws.OnMessage += OnWebSocketMessage;
                ws.Connect();
                Debug.Log("Webscoekt state: " + ws.IsAlive.ToString());
                return ws.IsAlive;
            #endif

            return true;
        }
        catch (Exception ex)
        {
            // Handle or log the exception
            Debug.LogError("Error occurred in ReConnect method: " + ex.Message);
            return false;
        }
    }

    private void OnDestroy()
    {
        if (ws != null && ws.IsAlive)
        {
            ws.Close();
        }
    }

    private void OnWebSocketMessage(object sender, MessageEventArgs e)
    {
        if (e.Data != null)
        {
            try
            {
                UnityMainThreadDispatcher.Instance().Enqueue(ThisWillBeExecutedOnTheMainThread(e.Data));
            }
            catch (Exception ex)
            {
                UnityMainThreadDispatcher.Instance().Enqueue(() => Debug.LogError("Error handling JSON message: " + ex.Message));
            }
        }
        else
        {
            UnityMainThreadDispatcher.Instance().Enqueue(() => Debug.LogWarning("Received empty JSON data."));
        }
    }

    public IEnumerator ThisWillBeExecutedOnTheMainThread(string jsonData)
    {
        //Debug.Log(\"This is executed from the main thread\");
        HandleJsonMessage(jsonData);
        yield return null;
    }

    [ContextMenu("func DEBUG RECIPE_RESPONSE")]
    public void THISISADEBUGFUNCTION()
    {
        var json = "{\"type\": \"RECIPE_RESPONSE\", \"data\": {\"recipe_name\": \"Greek Salad\", \"description\": \"Greek salad is a popular dish in Greece and other Mediterranean countries. It is made with tomatoes, cucumbers, onions, bell peppers, feta cheese, and olives. The salad is typically dressed with olive oil, lemon juice, and oregano.\", \"prep_time_minutes\": 15, \"cook_time_minutes\": 0, \"total_time_minutes\": 15, \"ingredients\": [{\"name\": \"Tomatoes\", \"quantity\": \"2\", \"unit\": \"cups\"}, {\"name\": \"Cucumbers\", \"quantity\": \"1\", \"unit\": \"cup\"}, {\"name\": \"Onions\", \"quantity\": \"1/2\", \"unit\": \"cup\"}, {\"name\": \"Bell peppers\", \"quantity\": \"1/2\", \"unit\": \"cup\"}, {\"name\": \"Feta cheese\", \"quantity\": \"1/2\", \"unit\": \"cup\"}, {\"name\": \"Olives\", \"quantity\": \"1/2\", \"unit\": \"cup\"}, {\"name\": \"Olive oil\", \"quantity\": \"1/4\", \"unit\": \"cup\"}, {\"name\": \"Lemon juice\", \"quantity\": \"2\", \"unit\": \"tablespoons\"}, {\"name\": \"Oregano\", \"quantity\": \"1\", \"unit\": \"teaspoon\"}], \"steps\": [{\"step_number\": 1, \"description\": \"Combine tomatoes, cucumbers, onions, bell peppers, feta cheese, and olives in a large bowl.\", \"image_url\": null}, {\"step_number\": 2, \"description\": \"Whisk together olive oil, lemon juice, and oregano in a small bowl.\", \"image_url\": null}, {\"step_number\": 3, \"description\": \"Pour dressing over salad and toss to coat.\", \"image_url\": null}, {\"step_number\": 4, \"description\": \"Serve immediately.\", \"image_url\": \"\"}], \"servings\": 4}}";
