    [ContextMenu("func DEBUG QUESTION_RESPONSE")]
    public void THISISALSOADEBUGFUNCTION()
    {
        var json = ;
        HandleJsonMessage(json);
    }

    public void HandleJsonMessage(string jsonData)
    {
        // Deserialize the JSON into JsonMessage class
        JsonMessage jsonMessage = JsonUtility.FromJson<JsonMessage>(jsonData);

        Debug.Log("Received json :" + jsonData);

        // Determine the type of data
        string messageType = jsonMessage.type;

        switch (messageType)
        {
            case "RECIPE_RESPONSE":
                RecipeMessage json = JsonUtility.FromJson<RecipeMessage>(jsonData);
                dataHandler.RecvResponse_Recipe(json.data);
                break;
            case "QUESTION_RESPONSE":
                PopupMessage json1 = JsonUtility.FromJson<PopupMessage>(jsonData);
                dataHandler.RecvResponse_Popup(json1.data);
                break;
            default:
                Debug.LogWarning("Unknown message type: " + messageType);
                break;
        }
    }

    public void SendJsonData(string jsonData)
    {
        if (ws != null && ws.IsAlive)
        {
            ws.Send(jsonData);
        }
    }
}

[Serializable]
public class JsonMessage
{
    public string type;
}

[Serializable]
public class RecipeMessage
{
    public string type;
    public RecipeData data;

    public override string ToString()
    {
        return type + " " + data.ToString();
    }
}

[Serializable]
public class PopupMessage
{
    public string type;
    public PopupData data;

    public override string ToString()
    {
        return type + " " + data.ToString();
    }
}
